import { REQUEST_LISTINGS, RECEIVE_LISTINGS } from '../actions';


export function properties(state = initialState, { type, data }) {
  switch (type) {
    case REQUEST_LISTINGS:
      return {
        ...state,
        data,
        loading: true
      };

    case RECEIVE_LISTINGS:
      return {
        ...state,
        data,
        loading: false
      };

    default:
      return state;
  }
}
